			<node ID="ID_524760933" TEXT="BEST PRACTICES FOR HEALTHCARE DATA GOVERNANCE. To avoid the mistakes that can lead to an unsuccessful data governance program The University of Kansas Hospital devised and implemented a number of best practices to build a solid data governance structure that would serve the hospital for years to come. Secure commitment from senior leaders. The " />
			</node>
		<node ID="ID_1555191791" LINK="https://en.wikipedia.org/wiki/Health_care" TEXT="Health care - Wikipedia">
			<node ID="ID_1695242613" TEXT="Health care health-care or healthcare is the maintenance or improvement of health via the prevention diagnosis treatment recovery or cure of disease illness injury and other physical and mental impairments in people. Health care is delivered by health professionals in allied health fields. Physicians and physician associates are a part of these health professionals." />
			</node>
		<node ID="ID_1810057089" LINK="https://www.pbisworld.com/tier-3/social-stories/how-to-make-a-social-story-fact-sheet/" TEXT="How To Make A Social Story Fact Sheet">
			<node ID="ID_400905058" TEXT="Another way of fading is to rewrite the story gradually removing directive sentences from the story. social stories can be used for many purposes. Social stories can be used for more than learning how to interact in social situations. They can be used to learn new routines activities and how to respond appropriately to feelings like anger " />
