		<node ID="ID_1653936986" LINK="https://www.healthcatalyst.com/healthcare-visualization-benefits" TEXT="How Healthcare Visualizations Can Improve Organizational ">
			<node ID="ID_524099970" TEXT="Healthcare visualizations are similar to today&#8217;s popular infographics except the data they show is specific to healthcare. With their easy-to-understand graphical representation of complex data healthcare visualizations can be used by anyone involved in healthcare improvements." />
			</node>
		<node ID="ID_1316101325" LINK="https://www.storyboardthat.com/articles/e/transitions-social-story" TEXT="Social Story Examples | Transitions  Unexpected Events">
			<node ID="ID_1520560432" TEXT="Individuals with Autism Spectrum Disorder (ASD) along with many other diagnoses thrive on routine and structure.However routine is not always possible. Sometimes a transition or an unexpected event occurs and changes a routine. Incorporating social stories about common upcoming transitions and unexpected events can help prepare students and reduce anxiety in changes to their regular schedule." />
