		<node ID="ID_1479989620" LINK="http://www.educateautism.com/social-stories/are-social-stories-effective.html" TEXT="Are Social Stories Effective? - Educate Autism">
			<node ID="ID_1709192188" TEXT="According to Kokina and Kern (2010 p. 825) the results from their meta-analysis on the effectiveness of Social Stories &#8216;confirmed previous findings regarding the questionable effectiveness of Social Story interventions for students with ASD&#8217; but they then also state that their &#8216;results do not imply that Social Stories are ineffective&#8217;." />
			</node>
