			<node ID="ID_439675010" TEXT="the problems in health care evident in the United States and abroad. His book Rede&#64257;ning Health Care (with Elizabeth Teisberg) develops a new frame-work for understanding how to transform the value delivered by the health care system. For more information visit the Institute for Strategy and Competitiveness web-site at www.isc.hbs.edu." />
