			<node ID="ID_1753220974" TEXT="EMS include basic and advanced life support. 17 Notable progress has been made in recent years to ensure that everyone has access to rapidly responding EMS; it is an important effort in improving the health of the population. 18. Timeliness. Timeliness is the health care systems ability to provide health care quickly after a need is recognized." />
